export default enter [
    {
      id: 1,
      img: process.env.PUBLIC_URL + '/assets/img1.png',
      name: 'Japan'
    },
    {
      id: 2,
      img: process.env.PUBLIC_URL + '/assets/img2.png',
      name: 'America'
    },
    {
      id: 3,
      img: process.env.PUBLIC_URL + '/assets/img3.png',
      name: 'France'
    }
  ];
